import React from "react";

const SearchResult=()=>{
    const img="https://source.unsplash.com/user/jackie/likes/600x400";
    return(
        <>
          <div>
              <img src={img} alt="randomImage" />
          </div>
        </>
    );
};
export default SearchResult;
